import React from "react";

const Creat = ({ props, creatureNumber, handleDrag, handleDrop }) => {
  return (
    <div
      draggable={true}
      id={creatureNumber}
      onDragOver={(ev) => ev.preventDefault()}
      onDragStart={handleDrag}
      onDrop={handleDrop}
    >
      <h2>{props.name}</h2>
    </div>
  );
};

export default Creat;
